#Count the number of trailing 0s in a factorial number.#function which outputs the factorial of a numberdef factorial(number):                                  #0(3n)    """function which outputs a varibles factorial"""       if number == 0:                                     #0(n)        return 1                                        #0(n)    else:        return number*factorial(number-1)               #0(n)number = int(input('Input a number.\n'))                #0(1)factor_answer = factorial(number)                       #0(1)print(factor_answer)                                    #0(1)notatend = True                                         #0(1)counter = 0                                             #0(1)while notatend == True:                                 #0(5n)    if factor_answer % 10 == 0:                         #0(n)        counter = counter + 1                           #0(n)        factor_answer = factor_answer / 10              #0(n)    else:        print("No more 0's found")                      #0(n)        break                                           #0(n)print(counter)                                          #0(1)#total big0 = 0(n)#% takes the remander of a question#break stops the loop when the else has been forfilled